import React from 'react';
import Card from './Card';
import { robots } from './robots';

const CardList = (props) => {
    const rows = props.robots.map((user, i) => {
        return (<Card id={props.robots[i].id} name={props.robots[i].name} email={props.robots[i].email} />);
    })
    return (
        <div>
            {rows}
        </div>
    )
}

export default CardList;
